import { useState } from "react";
import SwitchTabs from "./onBoarding";
import Welcome from "./welcomepage";

function Home() {
    const [isLogin, setLogin] = useState(false);
    // const formSubmit = (event) => {
    //     setLogin = true;
    // }
    return (
        <div>
            {
                isLogin ?
                    <Welcome/>
                :
                    <SwitchTabs/>
            }
            {/* Welcome */}
        </div>
    )
}
export default Home;
